import { AspectRatio } from '@chakra-ui/react';
import { ReactElement } from 'react';

import MainBg from './Bg.mp4';

export function BackgroundImage(): ReactElement {
  return (
    <AspectRatio w="100%" h="100%" ratio={1}>
      <iframe title="naruto" src={MainBg} allowFullScreen />
    </AspectRatio>
  );
}
